INSERT INTO `acs_email_templates` (`id`, `email_subject`, `email_address`, `email_message`, `cn_email_subject`, `cn_email_address`, `cn_email_message`, `status`, `created`) VALUES
(1, 'Welcome to multistage mlm', 'noreply@amicacs.com', '<p>Hi&nbsp;{FULL_NAME}</p>\r\n<p>Your login&nbsp;details</p>\r\n<p>Username:&nbsp;{USERID}</p>\r\n<p>Password :&nbsp;{PASSWORD}</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"color: #222222; font-family: arial, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">Congratulations for Joining Straight Line Apps LLC. You have made one of the best decisions&nbsp;<strong><u>ever!</u></strong></p>\r\n<p dir=\"ltr\" style=\"color: #222222; font-family: arial, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">We have been helping entrepreneurs Work At Home for over 20 years and you now have the best team of successful marketers<br /><strong><u>helping you on a journey to build a successful work-at-home income!&nbsp;</u></strong>We are a group of Internet designers, programmers, network marketers, crypto currency trainers, and social media lead generators.</p>\r\n<p dir=\"ltr\" style=\"color: #222222; font-family: arial, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">What does that all mean to you? Well, we have also built multiple down-lines<strong>&nbsp;</strong>for companies of<strong>&nbsp;</strong>350,000 and more<strong>.</strong>&nbsp;We stay on the cutting edge of the latest mobile technologies and have designed a very simple but powerful mobile app for social media marketing.</p>\r\n<p dir=\"ltr\" style=\"color: #222222; font-family: arial, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">When you joined, we<strong>&nbsp;</strong>created your Digi App similar to the one you saw from our marketing or one of your friends.&nbsp;</p>\r\n<p dir=\"ltr\" style=\"color: #222222; font-family: arial, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">You were also placed into our rapidly growing Straight Line. What does that mean? We are building a down-line of thousands so that we can help you (and all the other people who join with us) make money at home.</p>\r\n<p dir=\"ltr\" style=\"color: #222222; font-family: arial, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">Again, we are really excited about our Luxury Lifestyle Club and the potential of everyone who joins us.</p>\r\n<p dir=\"ltr\" style=\"color: #222222; font-family: arial, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">You will also have your own referral link to help with sharing the club with everyone who wants to work at home and help us grow.</p>\r\n<p style=\"color: #222222; font-family: arial, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">For more information: go to <a href=\"http://straightlineapps.biz\">http://straightlineapps.biz</a>.</p>\r\n<p style=\"color: #222222; font-family: arial, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">Straight Line Apps LLC</p>\r\n<p>&nbsp;</p>', NULL, NULL, NULL, 1, '0000-00-00');
