(1, 'About Us', '<p>Our team has been online since <em>Tim Berners</em>-<em>Lee</em> invented the World Wide Web. We were there before there were web pages and all of the flash and bells and whistles that exists today. For over 2 decades, we have invested tireless hours and money towards developing and implementing state of the art online technology to stay ahead of all the changes that have occurred since the Internet was conceived.</p>\r\n<p>Our main thrusts are global, mobile, and social; we have been on the cutting edge of these three movements.</p>\r\n<p><strong><u>Our record of accomplishment includes:</u></strong></p>\r\n<ul>\r\n<li>Development of the first dating, travel, texting, and mobile phone web sites</li>\r\n<li>The first radio program on Yahoo and one of first live streaming radio programs</li>\r\n<li>7 years of programming &amp; web design for Nascar on 1,500 home tracks</li>\r\n<li>Numerous consultations for small businesses for ecommerce</li>\r\n<li>The development of tens of thousands of &nbsp;team representatives</li>\r\n<li>One of the first to concentrate on mobile sites and mobile paymnets</li>\r\n</ul>\r\n<p><strong><u>Today, our main focus</u></strong> is helping small to large businesses leverage the huge upsurge in mobile social media marketing with online and offline advertising through our Digi App technology. We have combined all of our experience and marketing expertise in acquiring customers for businesses and providing brand advertising at very affordable rates.</p>\r\n<p><strong><u>What is The Digi App?</u></strong> It is the newest social mobile video marketing app that has been developed specifically for the mobile generation. There are over 28 million businesses in the U.S. and over 100 million worldwide. Every one of these businesses needs business cards and they all need mobile marketing solutions to effectively compete. An example- http://straightlineapps.net</p>\r\n<p>We have 3 solutions in one: The Straight Line App which is great for sharing individual or company information with videos, social media links, ad campaigns and lead generation. We are also utilizing our experience with gathering customers with ad campaigns. We are partners with Google and work directly with their ad department for you.</p>\r\n<p><strong>Let GOOGLE, FACEBOOK, and BING Do The Heavy Lifting!</strong></p>\r\n<p><strong>Get More Sales, for More Self Sustaining Revenue!</strong></p>\r\n<p><strong><u>Why The Smarter Card &ndash; Ad Agency Team<br /> </u></strong><br /> The SLA LLC is a company with the approach to drive highly targeted traffic with a laser focus on high-volume advertising campaigns for assisting its members.<br /> <br /> <strong><u>Who is the team behind the scenes?</u></strong><br /> Our team is a group of entrepreneurs with decades of Internet experience.&nbsp;We are listing our experience just so that you know that our history and track record speaks for itself.</p>\r\n<ul>\r\n<ul>\r\n<li>15 years affiliate management and program creation with implementation</li>\r\n<li>10 outsourcing relationship with International csr/data entry telemarketing centers</li>\r\n<li>15 years corporate consulting for creating and business to business development</li>\r\n<li>15 years HTML, PHP, database management creation, implementation and deployment</li>\r\n<li>Android UI and IOS app development and implementation</li>\r\n<li>Extensive wordpress, joomla and blogging experience.</li>\r\n<li>Social media marketing: Twitter, Facebook, Google Plus, and Linked in expertise</li>\r\n<li>Creating videos for corporate accounts: YouTube and Vimeo channels for clients</li>\r\n<li>MLM network marketing software development and implement</li>\r\n<li>Website SEO / SMM / adwords analysis and optimization</li>\r\n<li>Email blasts, advertising bulk text messaging,</li>\r\n<li>Backlinking and increasing brand awareness with ad campaigns</li>\r\n<li>Banner creation and generating low cost banner ROI</li>\r\n<li>Direct contacts for very low cost CPC campaigns</li>\r\n<li>With the list of all of the experience of creating ideas, consulting with businesses, website design and programming for small to large companies, social media marketing, it only stands to reason that you are working with online and offline experts.</li>\r\n</ul>\r\n</ul>', '2013-09-04'),
(2, 'LLC Membership', '<div><strong>Levels of SLA LLC Memberships</strong></div>\r\n<div>Gold, Diamond, Platinum</div>\r\n<div>&nbsp;</div>\r\n<div><u><strong>Limited Lifetime Partners:</strong></u></div>\r\n<div>&nbsp;</div>\r\n<div>$500 Gold - 500</div>\r\n<div>$1000 Diamond -100</div>\r\n<div>$5000 Platninum -50</div>\r\n<div>$10000 Millionaires -25</div>\r\n<div>\r\n<ul>\r\n<li>Benefits: recognized on the corporate site with names/spotlight Digi App/products</li>\r\n<li>in Member Area</li>\r\n<li>Special perks, first to have offers on purchases/new products/meeting recognition and more</li>\r\n<li>Partner Pool for Profits</li>\r\n</ul>\r\n<u><strong>Production Bonus Pools for Leaders</strong></u></div>\r\n<div>&nbsp;</div>\r\n<div>1. Bonus pool for each month based on production</div>\r\n<div>\r\n<ul>\r\n<li>Highest production based on new membership sales&nbsp;</li>\r\n<li>Highest production based on volume product sales</li>\r\n</ul>\r\n2. Leader Bonus Pool for Organization Builders</div>\r\n<div>\r\n<ul>\r\n<li>Personal Referrals 25 - Bonus Pool 1</li>\r\n<li>Personal Referrals 50 - Bonus Pool 1 &amp; 2</li>\r\n<li>Personal Referrals 100 - Bonus Pool 1, 2, &amp; 3</li>\r\n</ul>\r\n</div>', '2013-09-06'),
