uracy, and ensure the correct use of information, edenlife.club goes above and beyond appropriate industry standard procedures to safeguard the confidentiality of member\'s personal information, such as firewall, encryption, token authentication, application proxies, monitoring technology, and adaptive analysis of the website\'s traffic to track abuse of the club website and its data. However, no data transmitted over the internet can be 100% secure. As a result, while SLA Luxury Lifesytyle Club &nbsp;strives to protect its members personal information, cannot guarantee the security of any information that members transmit to or from the participating advertisers/merchants and member does so at his/her own risk.</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">If the account holder dies, then we\'ll verify documents to ensure the person who was willed their account or estate would have access to their SLA Luxury Lifesytyle Club membership.</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">If you do not agree with the above terms and conditions, please do not go any further.</span></li>\r\n</ul>\r\n<p><br /><br /></p>', '0000-00-00'),
(4, 'SLA Luxury Lifestyle Club ', '<div>SLA Luxury Lifestyle Club&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><strong><u>When you join the Straight Line Apps for Free here is what you get:</u></strong></div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<ul>\r\n<li>Your Marketing SLA App to promote the Straight Line</li>\r\n<li>You are placed in the Straight Line structure with everyone joining under your spot</li>\r\n<li>You are introduced to other SLA members on or social media marketing groups</li>\r\n</ul>\r\n</div>\r\n<div>&nbsp;</div>\r\n<div><strong><span style=\"font-size: large;\">Think about it:</span></strong></div>\r\n<div>&nbsp;</div>\r\n<div>Thousands of people who want to work at home are now joining under you in the Straight Line.&nbsp;<br />They all have one thing in common with you: they want to live the lifestyle dream of&nbsp;</div>\r\n<div>\r\n<ul>\r\n<li>Freedom from their Job or retirement</li>\r\n<li>Freedom from bills and lack of quality time with friends and family</li>\r\n<li>Freedom to live their lifestyle of their dreams</li>\r\n</ul>\r\n<div>So, if it is Free how do I make money with the LLC?</div>\r\n</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<div><strong><u>You and all members have an upgrade choice to pay only $49.00 with the upgrade here is what you get:</u></strong></div>\r\n<div><strong><u>&nbsp;</u></strong></div>\r\n<div>\r\n<ul>\r\n<li>Your own custom Mobile App- with your logo,business information,video,description, website link,social media plus more</li>\r\n<li>You are entered into the fast moving Straight Line with Phases with every new Straight Line App member pushing you thru the Phases.</li>\r\n<li>You are given choices for membership levels with owning the club Ocean Front Condos, Jets, Yachts and More</li>\r\n<li>You are given the opportunity for a brand new car and more</li>\r\n<li>You are also given the ability to market to all members in our social media groups</li>\r\n</ul>\r\n<div>Sounds to good to be true; right?</div>\r\n</div>\r\n</div>', '0000-00-00'),
(5, 'Contact us', '<p>Straight Line Apps LLC</p>\r\n<p>email: straightlineapps@gmail.com</p>', '0000-00-00'),
(6, 'Privacy Policy', '<p><strong>Introduction:</strong><span style=\"font-weight: 400;\">&nbsp; SLA Luxury Lifesytyle Club has a strong commitment to providing excellent service to all of our affiliates and customers, including respecting their concerns about privacy. We understand that visitors to our website may have questions about how this website collects and uses information. We have prepared this statement to inform you of the privacy principles that govern edenlife.club.</span></p>\r\n<p><span style=\"font-weight: 400;\">This statement contains numerous general and technical details about the steps we take to respect your privacy concerns. The bottom line is that meeting your needs and expectations form the foundation of everything we do - including protecting your privacy.</span></p>\r\n<p><strong>Browsing:</strong><span style=\"font-weight: 400;\"> This website does not collect personally identifiable information from your computer when you browse the site. This means that, unless you voluntarily and knowingly provide us with personally identifiable information, we will not know your name, your e-mail address, or any other personally identifiable information.</span></p>\r\n<p><strong>Internet Protocol (IP) Address:</strong><span style=\"font-weight: 400;\"> An IP address is a number that is automatically assigned to your computer when you browse the Internet. When users request a page from our site, our servers log the user\'s current IP address. We use IP addresses to help diagnose problems. We do not link IP addresses to any personally identifiable information about you.</span></p>\r\n<p><strong>Cookies:</strong><span style=\"font-weight: 400;\"> Our website uses cookie technology. Cookies are strings of text that a website may store on a user\'s computer. Our website uses cookies but only requires them in the online reservation process. Cookies enable our website to keep track of your preferences and activities relating to the website. Our website creates session cookies for each visit in order to facilitate your visit. The session cookie expires at the end of the session.</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Use of Cookies and E-Mails - We use a third party service provider to send marketing e-mails on behalf of SLA. There are no cookies in the e-mail. However, when an e-mail recipient clicks on a link to The SLA&nbsp;website included in the e-mail, a persistent cookie is placed on the user\'s computer. This cookie is used to measure the effectiveness of our e-mail marketing efforts and better understand how our users navigate through the site. The cookie set by our service provider will remain on your hard drive 30 days after the last time you clicked on the coded link in the e-mail, or until you delete it.</span></li>\r\n</ul>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Use of Cookies for Advertising - We use third party service providers to serve and host our advertisements. These third parties use persistent cookies to track the number of times our site is accessed and whether the site was accessed from the advertisement. The cookies generated from the advertisements do not contain personally identifiable information and may remain on your hard drive three or more years unless deleted by you.</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The third party service providers mentioned above are contractually bound not to use any information they gather for any purpose other than providing services to us. Cookies do not corrupt or damage your computer or computer files. In addition, we do not use cookies to gather information concerning your visits to non-SLA websites. If you do not wish to receive these cookies, you may set your browser to reject the cookies (consult the instructions for your particular browser on how to do this), although doing so may affect your ability to perform certain transactions on our website.</span></p>\r\n<p><strong>Tags:</strong><span style=\"font-weight: 400;\"> The third party service providers mentioned above serve and host SLA&nbsp;advertisements on other sites. To track the effectiveness of SLA&nbsp;advertisements on other sites, &nbsp;uses pixel SLA tags (also known as clear gifs, beacon gifs, 1-by-1 gifs, or web bugs). Pixel tags are not visible to the user of the site and consist of a few lines of computer coding. If you are visiting edenlife.club from an advertisement on another site, the pixel tag references the cookie you received when you clicked on the advertisement. The pixel tag then registers this activity with the third party advertising company to allow us to count the number of times an advertisement is accessed. In addition, we also measure the reservations generated from a particular ad. At no time is personally identifiable information about you or your reservation collected by the third party advertising company, nor is any tracking information generated from the pixel tag allowed to be used by them for any other purpose other than to report website activity to us or allow us to better target future interactive advertising.</span></p>\r\n<p><span style=\"font-weight: 400;\">Our third party service providers may use pixel tags in SLA&nbsp;marketing e-mails that help us send the e-mail in a format you can read, to allow us to know which e-mails you act upon and to better target the content of future e-mails. In addition, we track the aggregate number of e-mails read and whether any of the links in the e-mail were accessed. No other information is collected or used from pixel tags.</span></p>\r\n<p><strong>Information We Collect:</strong><span style=\"font-weight: 400;\"> When we need to collect personally identifiable information from you, we will ask you to voluntarily supply us with the information we need. For example, if you would like to create a SLA&nbsp;account or receive information regarding upcoming SLA&nbsp;technological advances, we will ask you for information such as name, address, telephone number, e-mail address, and quite possibly credit card number. We will use your e-mail address to send a confirmation and, if necessary, might use the other information to contact you for help to process the reservation. The same types of information may would be requested to complete any other membership related activity. As indicated below (see E-Mail section), we may also use your e-mail address to notify you about special offers and promotions.</span></p>\r\n<p><strong>Securing the Transmission and Storage of Information:</strong><span style=\"font-weight: 400;\"> When we ask you for credit card data when making a reservation or purchasing a gift certificate, it is transferred over a Secured Sockets Layer (SSL) line provided you are using a SSL enabled browser such as Safari, Google Chrome, Microsoft Internet Explorer, or the like. We also use SSL on other select pages where you would enter personally identifiable information. This ensures that your information is encrypted as it travels over the Internet. This secure mode is enabled before any such information is transmitted from your computer. You will know you are in secure mode when the padlock or key icon in the lower right-hand or left-hand corner of the computer screen appears in the locked position. In addition, when accessing a secure server, the first characters of the site address will change from http to https. After information reaches ELC it is stored on a secure server that resides behind firewalls designed to block unauthorized access from outside the Company.</span></p>\r\n<p><strong>E-Mail:</strong><span style=\"font-weight: 400;\"> It is our intention to only send you e-mail communications that will be useful to you and that you want to receive. When you make a reservation and provide your e-mail address, we will occasionally contact you via e-mail and provide information about special offers and promotions that may be of interest to you. These communications will relate to SLA&nbsp;offers and/or the promotions of select, reputable third parties with whom SLA has a strategic marketing relationship because they offer products or services that we believe would of interest to you. We use a third party e-mail service provider to send e-mails. This service provider is prohibited from using your e-mail address for any purpose other than to send SLA&nbsp;related e-mail. Every time you receive e-mail you will be provided the choice to opt-out of future e-mails by following the instructions provided in the e-mail, or you may opt-out by updating your online profile.</span></p>\r\n<p><strong>Use of Information:</strong><span style=\"font-weight: 400;\"> We treat the information you provide to us as confidential information; it is, accordingly, subject to our company\'s security procedures and strict corporate policies regarding protection and use of confidential information. Because laws applicable to personal information vary by country, our business operations may put in place additional measures that vary depending on the applicable legal requirements. Information collected on the sites covered by this privacy statement, which are listed in the first paragraph, is generally processed and stored on hosting/server accts.</span></p>\r\n<p><span style=\"font-weight: 400;\">The personally identifiable information you provide to us for making a reservation is made available to the applicable hotel for the purpose of meeting your reservation request. If you cancel your account, the information is stored for recordkeeping purposes only and is not accessed again. After creating your account, unless you specifically tell us otherwise, the information you provide may be used by us for direct marketing of SLA, the products of affiliates or select, reputable third parties with whom SLA&nbsp;has a strategic marketing relationship because they offer products or services that we believe would of interest to you. SLA&nbsp;may use the services of a third party mail house for the sole purpose of mailing materials.</span></p>\r\n<p><strong>Disclosure of Information to Third Parties:</strong><span style=\"font-weight: 400;\">&nbsp;SLA prohibits the sale or transfer of personal information to unaffiliated third parties outside of &nbsp;for SLA their use without your approval.</span></p>\r\n<p><strong>Links to Other Sites:</strong><span style=\"font-weight: 400;\"> If you choose to leave this SLA&nbsp;site via links to other non-SLA websites, including those of advertisers, SLA&nbsp;is not responsible for the privacy policies or content of those sites, nor is SLA responsible for the cookies those sites use.</span></p>\r\n<p><strong>Legal Issues:</strong><span style=\"font-weight: 400;\"> This is an internationally based website and is subject to the law of the US. SLA&nbsp;will disclose personally identifiable information without your permission when required by law, or in good faith belief that such action is necessary to investigate or protect against harmful activities to SLA&nbsp;guests, visitors, associates, or property (including this site), or to others when entities performing business activities on SLA\'s behalf necessitate such information (e.g., credit card processing or customer support services) or in the event that SLA&nbsp;is merged, acquired by or acquires another company. As mentioned above, laws related to personal identifiable information vary by country. For example, personally identifiable information collected &nbsp;is subject to the Data Protection Directive.</span></p>\r\n<p><strong>Privacy Policy Effective Date:</strong><span style=\"font-weight: 400;\"> The privacy policy is in effect at the time of each visit to our site. Please check our privacy policy each time you visit our website if you are concerned about how your information will be used.</span></p>\r\n<p><strong>SLA Club Privacy Statement Changes:</strong><span style=\"font-weight: 400;\"> In the future, we may need to change the privacy statement for club. All changes will be made here so that you will always know what information we gather, how we might use that information and whether we will disclose it to anyone.</span></p>\r\n<p><span style=\"font-weight: 400;\">For questions or comments regarding the Privacy Policy please email us at straightlineapps@gmail.com</span></p>\r\n<p><br /><br /></p>', '0000-00-00');
