(10, 'Straight Line That Just Plain Works! ', '<div class=\"wpb_text_column wpb_content_element  vc_custom_1473697939578\">\r\n<div class=\"wpb_wrapper\">\r\n<p style=\"text-align: justify;\"><strong>What Is THE L.L.C.?</strong></p>\r\n<p style=\"text-align: justify;\">Straight Line Apps LLC is a very unique combination of a Social Media Marketing Concept Plus a Luxury Lifestyle Membership for the members.</p>\r\n<p style=\"text-align: justify;\"><strong>A Straight Line With A TWIST!</strong></p>\r\n<p style=\"text-align: justify;\">Sign Up for Our SLA &ndash; Position Yourself In Front Of Thousands Joining NOW!</p>\r\n<div>Step 1 Participation:</div>\r\n<div>&nbsp;</div>\r\n<div>Straight Line Apps &ndash; Fre.e to Join and just by filling out the form you are placed underneath the last person who</div>\r\n<div>joins and every person after that is placed under the last person. A simple Straight Line.</div>\r\n<div>\r\n<ul>\r\n<li>You get: your Straight Line Mobile App</li>\r\n<li>You are placed in the Straight Line</li>\r\n<li>You get 10% commissions for direct sales referrals</li>\r\n</ul>\r\n<div>Step 2 Upgrade for Placing in the Straight Line Cycler</div>\r\n</div>\r\n<div>\r\n<ul>\r\n<li>You get your custom personal/business Mobile App</li>\r\n<li>You are placed in the Straight Line Cycler</li>\r\n<li>You are in position to earn money in the cycler</li>\r\n</ul>\r\n<div>Step 3 Select a Straight Line LLC (Luxury Lifestyle Club) Membership</div>\r\n</div>\r\n<div>Our membership includes the following:</div>\r\n<div>\r\n<ul>\r\n<li>You get webinars for social media marketing, crypto currency training, and more</li>\r\n<li>You get special discounts on travel, unique products available to members and more</li>\r\n<li>You get be mentored by our entrepreneurs and market your products to every member</li>\r\n<li>You get choices to participate in the fractional ownership with our Ocean Front Condos, Jets, Yachts</li>\r\n</ul>\r\n</div>\r\n<p style=\"text-align: justify;\">Our SLA LLC is designed that even those who start for free and work sharing their SLA LLC APP will be pushed thru the Phases. Every new member that joins under you advances you and earns you MONEY!</p>\r\n</div>\r\n</div>', '2016-09-16'),
